import React from "react";
import './FeaturedIntro.css'; 
import '../../App.css'

function FeaturedIntro(props) {
    return(
        <>
            <div className="featured-intro">
                <h2>{ props.title }</h2>
                <h5>{ props.date }</h5>
                <p>{ props.summary }</p>
                <h5>Responsibilities:</h5>

            </div>
        </>
    )
}

export default FeaturedIntro
